import React, { useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Aos from 'aos';
import './App.css';
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import UserInterface from './components/UserInterface/UserInterface';
import Services from './components/UserInterface/Services';
import Portfolio from './components/UserInterface/Portfolio';
import Contact from './components/UserInterface/Contact';
import Skills from './components/UserInterface/Skills'; // Import Skills component

function App() {
  useEffect(() => {
    Aos.init();
  }, []);

  return (
    <Router>
      <div className="App">
        <Header />
        <main>
          <Routes>
            <Route path="/" element={<UserInterface />} />
            <Route path="/services" element={<Services />} />
            <Route path="/portfolio" element={<Portfolio />} />
            <Route path="/skills" element={<Skills />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
